import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import Profile from './screens/Profile';
import Dashboard from './screens/Dashboard';
import Ph from './screens/Ph';
import TestingPage from './screens/TestingPage';
import TestingLoadingPage from './screens/TestingLoadingPage';
import TestingSensorPage from './screens/TestingSensorPage';
import StartPage from './screens/StartPage';
import WaterTestingScreen from './screens/WaterTestingScreen';
import Navigator from './homeStack';
import { TabNavFooter } from "./TabNavFooter";
import { SIGNIN_KEY, SIGNUP_KEY } from "../config/routeKeys";
import {
  SignupScreen,
  SigninScreen,
  MainFeedScreen,
  ProfilePageScreen,
  CommentScreen
} from "../screens";

export const Routes = StackNavigator({
  signin: { screen: SigninScreen },
  comments: { screen: CommentScreen },
  mainfeed: { screen: TabNavFooter },
  signup: { screen: SignupScreen },
  profilePage: { screen: ProfilePageScreen }
});

export default function App() {

